import React, { Component } from 'react';

class Text extends Component {
    render() {
        const name = 'سلطان';
        const job = 'مطور ويب';
        return (
            <div>
                <p>{`مرحباً يا ${name} وظيفتك هي ${job}`}</p>
            </div>
        );
    }
}

export default Text;
